const Chats = (props) => {
    return (
        <div>
            <Modal {...props}>

            <Chat handleNewUserMessage={this.handleNewUserMessage}
          profileAvatar={logo}
          title="My new awesome title"
          subtitle="And my cool subtitle" />
          </Modal>
        </div>
    )
}

export default Chats
